description:
Dare Dorm - Strip Pong.avi

Colorado is home to rocky mountains and thrill seekers, great beer and go for broke party schools. It was only a matter of time before a Colorado college submitted a tape to us. Now that we have got one in our hands, let me tell you what you already know. Beer pong is a great game for drunken debauchery. The night starts off like most, with beers and a casual game of beer pong going on. As always, inviting a pair of smoking hot girls over to play is a good idea. Even better than that idea is getting them to play strip beer pong.

